MUTATIONS[1348] = `mutation mutation1348 { createUserMeta(data: {oldId:"14089",user:{connect:{oldId:"667"}},metaType:"",metaName:"userBio",metaValue:"Picture%0D%0ACharles%20Ray%20Hill%20II%20%28born%20September%2023%2C%201990%29%2C%20better%20known%20by%20his%20stage%20name%20Ray%20Ray%20of%20Smoke%20One%20ENT%2C%20is%20an%20American%20rapper%20and%20music%20producer.%0D%0A%0D%0ARaised%20in%20Memphis%2C%20Tennessee%2C%20home%20of%20Oscar%20award%20winning%2C%20Three%206%20Mafia%2C%20by%20way%20of%20Flint%2C%20Michigan%2C%20HIll%20began%20writing%20and%20producing%20after%20being%20inspired%20by%20his%20older%20brother%20and%20stepfather%2C%20Memphis%20Beale%20Street%20legend%2C%20Vic%20Charles%20who%20played%20bass%20for%20Bootsy%20Collins%20and%20BB%20King%2C%20just%20to%20name%20a%20few.%0D%0A%0D%0ARay%20Ray%20has%20opened%20up%20for%20many%20known%20southern%20rap%20artists%2C%20such%20as%20Pastor%20Troy%2C%20La%20Chat%2C%20Mi%24cellaneous%2C%20a%20DJ%20at%20Hot%20107.1%20and%20artist%20on%20Wyte%20Music%20label%20ran%20by%20Lil%20Wyte.%20Ray%20Ray%20has%20done%20work%20with%20Koopsta%20Knicca%20of%20Da%20Mafia%206ix%2C%20Mastamind%20of%20the%20group%20Natas%2C%20on%20Esham%26%23039%3Bs%20label%20Real%20Life%20Product.%20Also%20he%20did%20work%20with%20Razakel%20of%20Serial%20Killer%20Records%2C%20DJ%20Paul%26%23039%3Bs%20nephew%2C%20Locodunit%20and%20Rebelyus%20of%20Y%20%26amp%3B%20D%20records.%0D%0A%0D%0AThe%20independent%20rapper%20began%20producing%20in%20late%202008%20when%20he%20founded%20his%20production%20label%20Smoke%20One%20ENT.%20Hill%20shows%20no%20mercy%20when%20it%20comes%20to%20his%20will%20to%20create%20music.%20Ray%20Ray%20has%20determination%20and%20takes%20pride%20in%20being%20the%20artist%20he%20is.%0D%0A%0D%0AFor%20booking%2C%20features%2C%20and%20contact%20SmokeOneENTJSM@gmail.com%20%0D%0Ahttp%3A//www.SmokeOneENTJSM@gmail.com%0D%0A",metaDeleted:false}) { id } } `
    
