MUTATIONS[1430] = `mutation mutation1430 { createUserMeta(data: {oldId:"14195",user:{connect:{oldId:"670"}},metaType:"",metaName:"userBio",metaValue:"Contrast%2C%20conflict%2C%20and%20a%20lurking%20darkness%20weave%20their%20way%20through%20Six%20Times%20Seven%26%23039%3Bs%20driving%20energy.%20A%2090s%20alternative%20core%20with%20a%20growling%20dose%20of%20early-70s%20proto-metal%20results%20in%20an%20intense%20package%20of%20diversity%20that%20reflects%20the%20same%20element%20in%20their%20roster.%0D%0A%0D%0ASinger/songwriter/guitarist%20Stevie%20Caldwell%20and%20songwriter/bassist%20Ron%20Levine%20forged%20Six%20Times%20Seven%20in%202011%20from%20the%20remains%20of%20the%20jam-oriented%20October%20Arrest%20with%20a%20tighter%20focus.%20Despite%20having%20little%20common%20musical%20ground%20%28Stevie%20was%20thinking%20Hole%20and%20Ron%20was%20thinking%20Hawkwind%29%2C%20they%20soon%20discovered%20that%20their%20tastes%20collided%20into%20a%20compelling%20tapestry.%20The%20addition%20of%20drummer%20Dave%20Zimmerman%20was%20the%20critical%20final%20piece%20of%20the%20puzzle%20for%20a%20band%20whose%20sound%20required%20both%20power%20and%20finesse.%0D%0A%0D%0AThe%20female-fronted%20rock%20trio%20has%20been%20likened%20to%2050%20Foot%20Wave%2C%20mid-period%20grungy%20Neil%20Young%2C%20and%20%26quot%3Blike%20Joan%20Armatrading%20fronting%20Queens%20of%20the%20Stone%20Age%20or%20a%20depressed%20Foo%20Fighters.%26quot%3B%20The%20delicate%20lead%20vocals%20against%20the%20harder%20instrumentation%20is%20a%20play%20on%20opposites%20that%20defines%20the%20feel%20of%20their%20music.%20It%26%23039%3Bs%20straight-forward%20rock%26%23039%3Bn%26%23039%3Broll%2C%20it%26%23039%3Bs%20smoky%20melodies%2C%20it%26%23039%3Bs%20emotion-laden%20stories.%20It%26%23039%3Bs%20lines%20blurred%20and%20redefined%20with%20unpredictable%20edges.%0D%0A%0D%0AThe%20band%20released%20debut%20EP%20%26quot%3BA%20Lesbian%2C%20a%20Jew%2C%20and%20a%20Dave%26quot%3B%20in%20July%202013.%20Recorded%20in%20their%20native%20Boston%2C%20the%20four%20tracks%20showcase%20the%20trio%26%23039%3Bs%20range%20and%20spirited%20delivery.%20%26quot%3BSomnambulist%26quot%3B%20exudes%20a%20dark%20pop%20sensibility%2C%20but%20is%20followed%20by%20the%20thunderous%20angst-ridden%20roar%20of%20%26quot%3BThe%20Devil%20Rise.%26quot%3B%20Lyrically%2C%20however%2C%20both%20tracks%20share%20a%20theme%20of%20personal%20insight%20and%20awareness%20which%20continues%20through%20the%20energetic%20anthem%20%26quot%3BAwake.%26quot%3B%20The%20final%20track%2C%20%26quot%3BCloser%2C%26quot%3B%20shifts%20between%20soft%20and%20heavy%20passages%20that%20reflect%20the%20simultaneously%20comforting%20and%20threatening%20lyrics%3B%20the%20delivery%20of%20lines%20like%20%26quot%3BI%20will%20only%20punish%20you%20if%20you%20don%26%23039%3Bt%20come%20closer%26quot%3B%20has%20been%20described%20as%20a%20%26quot%3Bsexy%20menace%20with%20a%20smile.%26quot%3B%20Available%20via%20iTunes%2C%20Amazon%2C%20CD%20Baby%2C%20and%20good%20old-fashioned%20CD%2C%20the%20EP%20has%20spent%20time%20on%20Bandcamp%26%23039%3Bs%20best%20seller%20list%20and%20the%20band%20supported%20the%20release%20with%20numerous%20live%20events.%0D%0A%0D%0AIn%20May%202015%2C%20Six%20Times%20Seven%20released%20similarly%20varied%20sophomore%20EP%20%26quot%3BIsh%2C%26quot%3B%20featuring%20the%20hook-laden%20%26quot%3BHindsight%2C%26quot%3B%20driving%20grind%20of%20%26quot%3BThe%20Last%20Resort%2C%26quot%3B%20and%20timeless%20class%20of%20%26quot%3BOne%20of%20These%20Days.%26quot%3B%20The%20band%20is%20now%20fleshing%20out%20several%20ideas%20for%20a%20follow-up%20full-length%20release.%0D%0A%0D%0AAbove%20all%2C%20Six%20Times%20Seven%20values%20the%20joy%20and%20human%20connections%20of%20music.%20This%20is%20a%20band%20that%20takes%20their%20art%20seriously%3B%20themselves%2C%20not%20so%20much.%20This%20might%20best%20be%20illustrated%20on%20the%20artwork%20for%20both%20%26quot%3BA%20Lesbian%2C%20a%20Jew%2C%20and%20a%20Dave%26quot%3B%20and%20%26quot%3BIsh%2C%26quot%3B%20which%20bear%20the%20dubious%20warning%3A%20%26quot%3BUnauthorized%20duplication%20is%20greatly%20encouraged.%20Share%20this%20bitch.%26quot%3B%0D%0A",metaDeleted:false}) { id } } `
    
