MUTATIONS[1445] = `mutation mutation1445 { createUserMeta(data: {oldId:"The band released debut EP \\\"A Lesbian, a Jew, and a Dave\\\" in July 2013. Recorded in their native Boston, the four tracks showcase the trio's range and spirited delivery. \\\"Somnambulist\\\" exudes a dark pop sensibility, but is followed by the thunderous angst-ridden roar of \\\"The Devil Rise.\\\" Lyrically, however, both tracks share a theme of personal insight and awareness which continues through the energetic anthem \\\"Awake.\\\" The final track, \\\"Closer,\\\" shifts between soft and heavy passages that reflect the simultaneously comforting and threatening lyrics; the delivery of lines like \\\"I will only punish you if you don't come closer\\\" has been described as a \\\"sexy menace with a smile.\\\" Available via iTunes, Amazon, CD Baby, and good old-fashioned CD, the EP has spent time on Bandcamp's best seller list and the band supported the release with numerous live events.",user:{connect:{}},metaValue:"undefined",metaDeleted:false}) { id } } `
    
