MUTATIONS[1459] = `mutation mutation1459 { createUserMeta(data: {oldId:"14220",user:{connect:{oldId:"670"}},metaType:"",metaName:"scDescription",metaValue:"Contrast%2C%20conflict%2C%20and%20a%20lurking%20darkness%20weave%20their%20way%20through%20Six%20Times%20Seven%27s%20driving%20energy.%20A%2090s-era%20alternative%20core%20with%20a%20dose%20of%20early-70s%20proto-metal%20growling%20beneath%2C%20their%20heavy%2C%20dynamic%20style%20of%20rock%20is%20an%20intense%20package%20of%20diversity%20that%20reflects%20the%20same%20element%20in%20their%20roster.%0A%0AThe%20female-fronted%20rock%20trio%20has%20been%20likened%20to%2050%20Foot%20Wave%2C%20mid-period%20grungy%20Neil%20Young%2C%20or%20%5C%22like%20Joan%20Armatrading%20fronting%20Queens%20of%20the%20Stone%20Age%20or%20a%20depressed%20Foo%20Fighters.%5C%22%20The%20soulful%20lead%20vocals%20--%20described%20by%20one%20reviewer%20as%20a%20%5C%22sexy%20menace%20with%20a%20smile%5C%22%20--%20against%20the%20harder%20instrumentation%20is%20a%20play%20on%20opposites%20that%20defines%20the%20feel%20of%20their%20music.%20It%27s%20straight-forward%20rock%27n%27roll%2C%20it%27s%20smoky%20melodies%2C%20it%27s%20emotion-laden%20stories.%20It%27s%20lines%20blurred%20and%20redefined.%20%0A%0AThe%20band%20released%20debut%20EP%20%5C%22A%20Lesbian%2C%20a%20Jew%2C%20and%20a%20Dave%5C%22%20in%20July%202013.%20Recorded%20in%20their%20native%20Boston%2C%20the%20four%20tracks%20showcase%20the%20trio%27s%20range%20and%20spirited%20delivery.%20%5C%22Somnambulist%5C%22%20exudes%20a%20dark%20pop%20sensibility%2C%20but%20is%20followed%20by%20the%20thunderous%20angst-ridden%20roar%20of%20%5C%22The%20Devil%20Rise.%5C%22%20Lyrically%2C%20however%2C%20both%20tracks%20share%20a%20theme%20of%20personal%20insight%20and%20awareness%20which%20continues%20through%20the%20energetic%20anthem%20%5C%22Awake.%5C%22%20The%20final%20track%2C%20%5C%22Closer%2C%5C%22%20shifts%20between%20soft%20and%20heavy%20passages%20that%20reflect%20the%20simultaneously%20comforting%20and%20threatening%20lyrics%3B%20the%20delivery%20of%20lines%20like%20%5C%22I%20will%20only%20punish%20you%20if%20you%20don%27t%20come%20closer%5C%22%20has%20been%20described%20as%20a%20%5C%22sexy%20menace%20with%20a%20smile.%5C%22%20Available%20via%20iTunes%2C%20Amazon%2C%20CD%20Baby%2C%20and%20good%20old-fashioned%20CD%2C%20the%20EP%20has%20spent%20time%20on%20Bandcamp%27s%20best%20seller%20list%20and%20the%20band%20supported%20the%20release%20with%20numerous%20live%20events.%0A%0AIn%20May%202015%2C%20Six%20Times%20Seven%20released%20similarly%20varied%20sophomore%20EP%20%5C%22Ish%2C%5C%22%20featuring%20the%20hook-laden%20%5C%22Hindsight%2C%5C%22%20driving%20grind%20of%20%5C%22The%20Last%20Resort%2C%5C%22%20and%20timeless%20class%20of%20%5C%22One%20of%20These%20Days.%5C%22%20The%20band%20is%20now%20fleshing%20out%20several%20ideas%20for%20a%20follow-up%20full-length%20release.%0A",metaDeleted:false}) { id } } `
    
